import React from "react";
import { Map, GoogleApiWrapper } from "google-maps-react";

const mapStyles = {
  width: "100%",
  height: "100%"
};

export class MyMapCopmponent extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={14}
        style={mapStyles}
        initialCenter={{
          lat: 34,
          lng: 72
        }}
      />
    );
  }
}
export default GoogleApiWrapper({
  apiKey: "AIzaSyAU7yST2vulRFkJsvwdZI0xRXY_Qafm85E"
})(MyMapCopmponent);
